package java_dsa;

import java.util.Scanner;

public class fun {
	public static void printMyName(String name) {
		System.out.println(name);
		return;
		
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc=new Scanner(System.in);
		String name =sc.next();
		
		printMyName(name);

	}

}
